css:
.nuclide-ok-cancel {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
.nuclide-password {
  background-color: #212224;
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
  color: #aaaaaa;
  line-height: 25px;
  padding: 0 0.5em;
  resize: none;
  width: 100%;
}
.password-prompt-container {
  padding: 10px;
}
.nuclide-auth-selector {
  margin-bottom: 20px;
}
.nuclide-auth-method {
  align-items: center;
  display: flex;
  height: 30px;
}
.nuclide-auth-method-input,
.nuclide-auth-method-label {
  display: inline-block;
}
.nuclide-auth-method-input {
  margin-left: 1em;
}
.nuclide-auth-method-label {
  min-width: 8em;
}
.nuclide-auth-method-password,
.nuclide-auth-method-privatekey {
  width: 250px;
}
.nuclide-auth-method-privatekey {
  margin-top: 10px;
}
